-- ----------------------------
-- procedure structure for Web_C_DonViHC_GetPage
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[Web_C_DonViHC_GetPage]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[Web_C_DonViHC_GetPage]
GO

CREATE PROCEDURE [dbo].[Web_C_DonViHC_GetPage]
	@SortCol NVARCHAR(30),
	@PageIndex INT,
	@PageSize INT,
	@TotalRows INT OUTPUT
AS

	WITH temp 
	as
	(
		SELECT * ,ROW_NUMBER() OVER (ORDER BY Id desc) as RowNum
		FROM dbo.C_DonViHC
	)
	select * from temp
	WHERE RowNum BETWEEN (@PageIndex - 1) * @PageSize + 1 
		  AND @PageIndex * @PageSize 

SELECT @TotalRows = COUNT(*) FROM dbo.C_DonViHC
GO


-- ----------------------------
-- procedure structure for C_DonViHC_GetPage_Web
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[C_DonViHC_GetPage_Web]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[C_DonViHC_GetPage_Web]
GO

CREATE PROCEDURE [dbo].[C_DonViHC_GetPage_Web]
    @SortCol NVARCHAR(50),
    @Skip INT,
    @Take INT,
    @SearchText NVARCHAR(200) = NULL,
    @Cap NVARCHAR(50) = NULL,
    @IdCha BIGINT = NULL,
    @TotalRows INT OUTPUT
AS
BEGIN
    SET NOCOUNT ON;

    -- 1. Xử lý cột sắp xếp và hướng sắp xếp
    DECLARE @SortColumn NVARCHAR(50), @SortDirection NVARCHAR(4);
    
    SET @SortColumn = LTRIM(RTRIM(LEFT(@SortCol, CHARINDEX(' ', @SortCol + ' ') - 1)));
    SET @SortDirection = UPPER(LTRIM(RTRIM(REPLACE(@SortCol, @SortColumn, ''))));

    IF @SortDirection NOT IN ('ASC', 'DESC')
        SET @SortDirection = 'ASC'; 

    -- 2. Xây dựng mệnh đề WHERE (SỬ DỤNG THAM SỐ HÓA)
    DECLARE @DynamicWhere NVARCHAR(MAX) = N' 1=1 ';
    DECLARE @SearchTextParam NVARCHAR(202) = NULL;
    
    IF @SearchText IS NOT NULL AND @SearchText <> ''
    BEGIN
        SET @SearchTextParam = '%' + @SearchText + '%'; -- Thêm Wildcard
        SET @DynamicWhere += N' AND (MaHC LIKE @SearchTextParam OR Ten LIKE @SearchTextParam) ';
    END

    IF @Cap IS NOT NULL AND @Cap <> ''
    BEGIN
        -- @Cap sẽ được truyền qua tham số trực tiếp trong EXEC, không cần thay đổi @DynamicWhere
        SET @DynamicWhere += N' AND Cap = @Cap '; 
    END

    IF @IdCha IS NOT NULL
    BEGIN
        -- @IdCha sẽ được truyền qua tham số trực tiếp trong EXEC, không cần thay đổi @DynamicWhere
        SET @DynamicWhere += N' AND IdCha = @IdCha ';
    END
    
    -- 3. Truy vấn TỔNG SỐ HÀNG (COUNT) trước
    -- Sử dụng sp_executesql để gán @TotalRows
    DECLARE @SQL_Count NVARCHAR(MAX) = N'
        SELECT @TotalRowsOut = COUNT(Id)
        FROM dbo.C_DonViHC
        WHERE ' + @DynamicWhere;

    EXEC sp_executesql @SQL_Count, 
                       N'@SearchTextParam NVARCHAR(202), @Cap NVARCHAR(50), @IdCha BIGINT, @TotalRowsOut INT OUTPUT', 
                       @SearchTextParam = @SearchTextParam, 
                       @Cap = @Cap, 
                       @IdCha = @IdCha, 
                       @TotalRowsOut = @TotalRows OUTPUT;


    -- 4. Truy vấn DỮ LIỆU phân trang (SELECT)
    DECLARE @SQL_Select NVARCHAR(MAX) = N'
        SELECT *
        FROM dbo.C_DonViHC
        WHERE ' + @DynamicWhere + N'
        ORDER BY ' + QUOTENAME(@SortColumn) + ' ' + @SortDirection + N'
        OFFSET @Skip ROWS
        FETCH NEXT @Take ROWS ONLY;';

    -- Thực thi truy vấn SELECT (Chỉ truy vấn SELECT được trả về cho ứng dụng)
    EXEC sp_executesql @SQL_Select,
                       N'@SearchTextParam NVARCHAR(202), @Cap NVARCHAR(50), @IdCha BIGINT, @Skip INT, @Take INT',
                       @SearchTextParam = @SearchTextParam,
                       @Cap = @Cap,
                       @IdCha = @IdCha,
                       @Skip = @Skip,
                       @Take = @Take;
END;
GO


