-- ----------------------------
-- function structure for fnSplit
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[fnSplit]') AND type IN ('FN', 'FS', 'FT', 'IF', 'TF'))
	DROP FUNCTION[dbo].[fnSplit]
GO

CREATE FUNCTION [dbo].[fnSplit](
    @sInputList VARCHAR(max) -- List of delimited items
  , @sDelimiter VARCHAR(max) = ',' -- delimiter that separates items
) RETURNS @List TABLE (item VARCHAR(max))

BEGIN
DECLARE @sItem VARCHAR(max)
WHILE CHARINDEX(@sDelimiter,@sInputList,0) <> 0
 BEGIN
 SELECT
  @sItem=RTRIM(LTRIM(SUBSTRING(@sInputList,1,CHARINDEX(@sDelimiter,@sInputList,0)-1))),
  @sInputList=RTRIM(LTRIM(SUBSTRING(@sInputList,CHARINDEX(@sDelimiter,@sInputList,0)+LEN(@sDelimiter),LEN(@sInputList))))
 
 IF LEN(@sItem) > 0
  INSERT INTO @List SELECT @sItem
 END

IF LEN(@sInputList) > 0
 INSERT INTO @List SELECT @sInputList -- Put the last item in
RETURN
END
GO


-- ----------------------------
-- procedure structure for C_DonViHC_Update_Web
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[C_DonViHC_Update_Web]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[C_DonViHC_Update_Web]
GO

CREATE PROCEDURE [dbo].[C_DonViHC_Update_Web] 
    @Id         BIGINT,
    @MaHC       NVARCHAR(MAX),
    @Ten        NVARCHAR(MAX),
    @TenTat     NVARCHAR(MAX),
    @IdCha      NVARCHAR(MAX),
    @Vung       NVARCHAR(MAX),
    @Cap        NVARCHAR(MAX),
    @Status     NVARCHAR(MAX),
    @HeSoKV     NVARCHAR(MAX),
    @LePhi      NVARCHAR(MAX),
    @MaV        NVARCHAR(MAX),
    @FolderExp  NVARCHAR(MAX),
    @ApDung     NVARCHAR(MAX),
    @Version    BIGINT,
		@IsUpdate   INT
AS
BEGIN
    SET NOCOUNT ON;

    -- 🟢 Kiểm tra bản ghi tồn tại
    IF EXISTS (SELECT 1 FROM C_DonViHC WHERE Id = @Id)
    BEGIN
        UPDATE C_DonViHC
        SET 
            [MaHC]       = @MaHC,
            [Ten]        = @Ten,
            [TenTat]     = @TenTat,
            [IdCha]      = @IdCha,
            [Vung]       = @Vung,
            [Cap]        = @Cap,
            [Status]     = @Status,
            [HeSoKV]     = @HeSoKV,
            [LePhi]      = @LePhi,
            [MaV]        = @MaV,
            [FolderExp]  = @FolderExp,
            [ApDung]     = @ApDung,
            [Version]    = @Version,
            [IsUpdate]   = @IsUpdate
        WHERE [Id] = @Id;

        SELECT 1 AS Result, 'Cập nhật thành công' AS Message;
    END
    ELSE
    BEGIN
        SELECT 0 AS Result, 'Không tìm thấy bản ghi cần cập nhật' AS Message;
    END
END
GO


-- ----------------------------
-- procedure structure for C_DonViHC_Insert_Web
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[C_DonViHC_Insert_Web]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[C_DonViHC_Insert_Web]
GO

CREATE PROCEDURE [dbo].[C_DonViHC_Insert_Web] 
    @MaHC        NVARCHAR(MAX), 
    @Ten         NVARCHAR(MAX), 
    @TenTat      NVARCHAR(MAX), 
    @IdCha       NVARCHAR(MAX), 
    @Vung        NVARCHAR(MAX), 
    @Cap         NVARCHAR(MAX), 
    @Status      NVARCHAR(MAX), 
    @HeSoKV      NVARCHAR(MAX), 
    @LePhi       NVARCHAR(MAX), 
    @MaV         NVARCHAR(MAX), 
    @FolderExp   NVARCHAR(MAX), 
    @ApDung      NVARCHAR(MAX), 
    @Version     BIGINT,
		@IsUpdate    INT
AS
BEGIN
    SET NOCOUNT ON;

    DECLARE @NewId BIGINT;

    -- 🟢 Bước 1: INSERT bình thường (Id tự tăng)
    INSERT INTO C_DonViHC (
        [MaHC],
        [Ten],
        [TenTat],
        [IdCha],
        [Vung],
        [Cap],
        [Status],
        [HeSoKV],
        [LePhi],
        [MaV],
        [FolderExp],
        [ApDung],
        [Version],
				[IsUpdate]
    )
    VALUES (
        @MaHC,
        @Ten,
        @TenTat,
        @IdCha,
        @Vung,
        @Cap,
        @Status,
        @HeSoKV,
        @LePhi,
        @MaV,
        @FolderExp,
        @ApDung,
        @Version,
				@IsUpdate
    );

    -- 🟢 Bước 2: Lấy Id vừa sinh
    SET @NewId = SCOPE_IDENTITY();

    -- 🟢 Bước 3: Gán IdHC = Id
    UPDATE C_DonViHC
    SET IdHC = @NewId
    WHERE Id = @NewId;

    -- 🟢 Bước 4: Trả về Id mới
    SELECT @NewId AS NewId;
END
GO


